code.value:
RFE_ERROR_GUARD
{
    // place holder
}

rfeHwSpi_module_t tsenseSpiModuleId;

RFE_ERROR_GUARD
{
    tsenseSpiModuleId = rfeHwTsense_indexMapperToSPIModule( tSenseIndex, RFE_ERROR_FUNCTION_ARGUMENT );

    // TEMPSENSOR1.PON_CTL.PON_LS=1;    //	Enable level shifters	(analog pin = d_pon_ls)
    rfeHwSpi_setBit(tsenseSpiModuleId, RFE_HW_TSENSE_PON_CTL_REG, RFE_HW_TSENSE_PON_CTL_PON_LS_BIT, RFE_ERROR_FUNCTION_ARGUMENT);

    // wait 1[us] before moving from STDBY to ON
}

rfeHwSpi_module_t tsenseSpiModuleId;

RFE_ERROR_GUARD
{
    tsenseSpiModuleId = rfeHwTsense_indexMapperToSPIModule( tSenseIndex, RFE_ERROR_FUNCTION_ARGUMENT );

    //  == Temperature Sensor IP is STDBY state ==
    //  == Temperature Sensor IP is NOW IN ON mode and can be triggered to do a temperature conversion (using the TDC_CTL.START field)tempSpiModule
    // by default (HW reset value), TDC_CTL.EXT_TRIG_EN = 0, so SW can trigger the conversion.
    rfeHwSpi_setBit(tsenseSpiModuleId, RFE_HW_TSENSE_PON_CTL_REG, RFE_HW_TSENSE_PON_CTL_PWR_EN_BIT, RFE_ERROR_FUNCTION_ARGUMENT);
}

RFE_ERROR_GUARD
{
    rfeHwSpi_module_t tsenseSpiModuleId, tsenseReadSpiModId;
    tsenseSpiModuleId = rfeHwTsense_selectMapperToSPIModule( tSenseSelect , RFE_ERROR_FUNCTION_ARGUMENT );
    tsenseReadSpiModId = tsenseSpiModuleId;
    if (tsenseReadSpiModId == RFE_HW_SPI_TEMP_MC_MODULE)
    {
        tsenseReadSpiModId = RFE_HW_SPI_TEMP_1_MODULE;
    }

    //  == Temperature Sensor IP is ON state ==
    // TODO: Convert to clearBit function from STRX-7838
    rfeHwSpi_register32_t spiRegValue = rfeHwSpi_read( tsenseReadSpiModId, RFE_HW_TSENSE_PON_CTL_REG, RFE_ERROR_FUNCTION_ARGUMENT );

    spiRegValue &= ( ~( 1ul << RFE_HW_TSENSE_PON_CTL_PWR_EN_BIT ) );
    spiRegValue |= ( 0ul << RFE_HW_TSENSE_PON_CTL_PWR_EN_BIT );

    rfeHwSpi_write( tsenseSpiModuleId, RFE_HW_TSENSE_PON_CTL_REG, spiRegValue, RFE_ERROR_FUNCTION_ARGUMENT );
    //  == Temperature Sensor IP is NOW IN STDBY mode
}

RFE_ERROR_GUARD
{
    rfeHwSpi_module_t tsenseSpiModuleId, tsenseReadSpiModId;
    tsenseSpiModuleId = rfeHwTsense_selectMapperToSPIModule( tSenseSelect , RFE_ERROR_FUNCTION_ARGUMENT );
    tsenseReadSpiModId = tsenseSpiModuleId;
    if (tsenseReadSpiModId == RFE_HW_SPI_TEMP_MC_MODULE)
    {
        tsenseReadSpiModId = RFE_HW_SPI_TEMP_1_MODULE;
    }

    //  == Temperature Sensor IP is in STDBY state ==
    // TODO: Convert to clearBit function from STRX-7838
    rfeHwSpi_register32_t spiRegValue = rfeHwSpi_read( tsenseReadSpiModId, RFE_HW_TSENSE_PON_CTL_REG, RFE_ERROR_FUNCTION_ARGUMENT );

    spiRegValue &= ( ~( 1ul << RFE_HW_TSENSE_PON_CTL_PON_LS_BIT ) );
    spiRegValue |= ( 0ul << RFE_HW_TSENSE_PON_CTL_PON_LS_BIT );

    rfeHwSpi_write( tsenseSpiModuleId, RFE_HW_TSENSE_PON_CTL_REG, spiRegValue, RFE_ERROR_FUNCTION_ARGUMENT );
    //  == Temperature Sensor IP is NOW IN OFF MODE
}

bool conversionReady = false;
rfeHwSpi_registerBit_t bitToRead;

if ( rfeHwTsense_temperatureFormat_direct_value == temperatureOutputFormat )
{
    bitToRead = RFE_HW_TSENSE_TDC_STATUS_TEMPOUT_VALID_BIT;
}
else
{
    bitToRead = RFE_HW_TSENSE_TDC_STATUS_ADCOUT_VALID_BIT;
}

conversionReady = rfeHwSpi_readBit( rfeHwTsense_indexMapperToSPIModule( tSenseIndex, RFE_ERROR_FUNCTION_ARGUMENT ),
                                    RFE_HW_TSENSE_TDC_STATUS_REG,
                                    bitToRead,
                                    RFE_ERROR_FUNCTION_ARGUMENT );

return conversionReady;

rfe_temperature_t readTemperature = 0;

RFE_ERROR_GUARD
{

    if ( rfeHwTsense_getConversionCompleted( tSenseIndex,
                                             rfeHwTsense_temperatureFormat_direct_value,
                                             RFE_ERROR_FUNCTION_ARGUMENT ) )
    {
        rfeHwSpi_register32_t regValue = rfeHwSpi_read( rfeHwTsense_indexMapperToSPIModule( tSenseIndex, RFE_ERROR_FUNCTION_ARGUMENT ),
                                                        RFE_HW_TSENSE_TDC_OUT0_REG,
                                                        RFE_ERROR_FUNCTION_ARGUMENT );

        readTemperature = rfeHwTsense_unpackBitsViaMask( regValue,
                                                         RFE_HW_TSENSE_TDC_OUT0_TEMPOUT_MSK,
                                                         RFE_HW_TSENSE_TDC_OUT0_TEMPOUT_SHF );
    }
    else
    {
        RFE_ERROR_SET( rfe_error_tSenseConversionInProgress_e );
    }

}

return readTemperature;

rfe_temperature_t temperature = 0;
rfeHwSpi_module_t tSensorAddrSPI = rfeHwTsense_indexMapperToSPIModule( tSenseIndex, RFE_ERROR_FUNCTION_ARGUMENT );

#ifdef RFE_HW_TSENSE_USE_FLOATING_POINT

// Notice that adcOut is in Q15 fixed point format, we need to adjust the scaling factor prior to operate with them as float
float adcOut = ( float ) ( ( rfeHwTsense_fixedPointQ15_t ) rfeHwTsense_getRawAdcOutput( tSenseIndex,
                                                                                        RFE_ERROR_FUNCTION_ARGUMENT ) )/ RFE_HW_TSENSE_FIXED_POINT_Q15_FORMAT;

rfeHwSpi_register32_t regFittingParamsAB = rfeHwSpi_read( tSensorAddrSPI,
                                                          RFE_HW_TSENSE_TDC_CAL0_REG,
                                                          RFE_ERROR_FUNCTION_ARGUMENT );

rfeHwSpi_register32_t regFttingParamsAlphaXoffset = rfeHwSpi_read( tSensorAddrSPI,
                                                                   RFE_HW_TSENSE_TDC_CAL1_REG,
                                                                   RFE_ERROR_FUNCTION_ARGUMENT );

RFE_ERROR_GUARD
{
    // Unpack the values from the register variable
    // Notice that valAa and valB are in Q6 fixed point format, we need to adjust the scaling factor prior to operate with them as float
    float valA = ( float ) ( ( rfeHwTsense_fixedPointQ6_t ) rfeHwTsense_unpackBitsViaMask( regFittingParamsAB,
                                                                                           RFE_HW_TSENSE_TDC_CAL0_VAL_A_MSK,
                                                                                           RFE_HW_TSENSE_TDC_CAL0_VAL_A_SHF ) ) / RFE_HW_TSENSE_FIXED_POINT_Q6_FORMAT;
    float valB = ( float ) ( ( rfeHwTsense_fixedPointSQ6_t ) rfeHwTsense_unpackBitsViaMask( regFittingParamsAB,
                                                                                            RFE_HW_TSENSE_TDC_CAL0_VAL_B_MSK,
                                                                                            RFE_HW_TSENSE_TDC_CAL0_VAL_B_SHF ) ) / RFE_HW_TSENSE_FIXED_POINT_Q6_FORMAT;

    // Notice that valAlpha and valXoffset are in Q11 fixed point format, we need to adjust the scaling factor prior to operate with them as float
    float valAlpha = ( float ) ( ( rfeHwTsense_fixedPointQ11_t ) rfeHwTsense_unpackBitsViaMask( regFttingParamsAlphaXoffset,
                                                                                                RFE_HW_TSENSE_TDC_CAL1_VAL_ALPHA_MSK,
                                                                                                RFE_HW_TSENSE_TDC_CAL1_VAL_ALPHA_SHF ) ) / RFE_HW_TSENSE_FIXED_POINT_Q11_FORMAT;
    float valXoffset = ( float ) ( ( rfeHwTsense_fixedPointSQ11_t ) rfeHwTsense_unpackBitsViaMask( regFttingParamsAlphaXoffset,
                                                                                                   RFE_HW_TSENSE_TDC_CAL1_VAL_XOFFSET_MSK,
                                                                                                   RFE_HW_TSENSE_TDC_CAL1_VAL_XOFFSET_SHF ) ) / RFE_HW_TSENSE_FIXED_POINT_Q11_FORMAT;

    /* Applying Trimming equation in section 10.3 Trimming Equations of temperature sensor documentation C028HPCP_TDC1DG10K
     * C028HPCP High Accuracy Temperature-to-Digital Converter Rev. 0.3, 18 March 2020
     */
    float tTrim = RFE_HW_TSENSE_ZERO;

    // Denominator of tTrim equation
    float xOut = RFE_HW_TSENSE_ADC_INTERNAL_GAIN_STAGE_NADC / adcOut;
    float denominator = valAlpha + xOut - valXoffset;
    // Division by zero check
    if ( denominator == RFE_HW_TSENSE_ZERO )
    {
        RFE_ERROR_SET( rfe_error_tSenseDivisionByZero_e );
    }
    else
    {
        tTrim = valA * ( valAlpha / denominator ) + valB;
    }

    // Cast the result into an rfe_temperature_t using Q6 format
    temperature = ( tTrim > RFE_HW_TSENSE_ZERO ) ? ( rfe_temperature_t ) ( ( tTrim * RFE_HW_TSENSE_FIXED_POINT_Q6_FORMAT ) + RFE_HW_TSENSE_MINIMIZE_ROUNDING_CASTING_CONST )
                                                 : ( rfe_temperature_t ) ( ( tTrim * RFE_HW_TSENSE_FIXED_POINT_Q6_FORMAT ) - RFE_HW_TSENSE_MINIMIZE_ROUNDING_CASTING_CONST );
}

#else

// Notice that adcOut is in Q15 fixed point format
rfeHwTsense_fixedPointQ15_t adcOut = rfeHwTsense_getRawAdcOutput( tSenseIndex,
                                                                  RFE_ERROR_FUNCTION_ARGUMENT );

rfeHwSpi_register32_t regFittingParamsAB = rfeHwSpi_read( tSensorAddrSPI,
                                                          RFE_HW_TSENSE_TDC_CAL0_REG,
                                                          RFE_ERROR_FUNCTION_ARGUMENT );

rfeHwSpi_register32_t regFttingParamsAlphaXoffset = rfeHwSpi_read( tSensorAddrSPI,
                                                                   RFE_HW_TSENSE_TDC_CAL1_REG,
                                                                   RFE_ERROR_FUNCTION_ARGUMENT );

RFE_ERROR_GUARD
{

    // Unpack the values from the register variable
    // Notice that valAa and valBt are in Q6 fixed point format
    rfeHwTsense_fixedPointQ6_t valA = rfeHwTsense_unpackBitsViaMask( regFittingParamsAB,
                                                                     RFE_HW_TSENSE_TDC_CAL0_VAL_A_MSK,
                                                                     RFE_HW_TSENSE_TDC_CAL0_VAL_A_SHF );
    rfe_temperature_t valB = rfeHwTsense_unpackBitsViaMask( regFittingParamsAB,
                                                            RFE_HW_TSENSE_TDC_CAL0_VAL_B_MSK,
                                                            RFE_HW_TSENSE_TDC_CAL0_VAL_B_SHF );

    // Notice that valAlpha and valXoffset are in Q11 fixed point format, we will need to adjust the scaling factor to Q6, thus we need a right shift of Q11-Q6=5
    rfeHwTsense_fixedPointQ11_t valAlpha = rfeHwTsense_unpackBitsViaMask( regFttingParamsAlphaXoffset,
                                                                          RFE_HW_TSENSE_TDC_CAL1_VAL_ALPHA_MSK,
                                                                          RFE_HW_TSENSE_TDC_CAL1_VAL_ALPHA_SHF );
    // Notice that valXoffset in is Q6
    rfe_temperature_t valXoffset = ( rfeHwTsense_unpackBitsViaMask( regFttingParamsAlphaXoffset,
                                                                    RFE_HW_TSENSE_TDC_CAL1_VAL_XOFFSET_MSK,
                                                                    RFE_HW_TSENSE_TDC_CAL1_VAL_XOFFSET_SHF ) >> RFE_WH_TSENSE_CONVERSION_BITS_Q11_TO_Q6 );

    /* Applying Trimming equation in section 11.3 Trimming Equations of temperature sensor documentation C028HPCP_TDC1DG10K
     * C028HPCP High Accuracy Temperature-to-Digital Converter Rev. 1.4, 14 October 2020
     */
    /*  xOut calculation in fixed point SQ6 this will be NadcQ21[Q21] / adcOutQ15[Q15] = Q6 but we encapsulate in int16 */
    rfe_temperature_t xOutSQ6 = ( rfe_temperature_t ) ( ( RFE_HW_TSENSE_ADC_INTERNAL_GAIN_STAGE_NADC_Q21 / adcOut ) );

    /* Denominator of main equation as result of fixed point operations
     using denominator[SQ6] = (valAlpha[Q11] >> 5)[SQ6] + xOutSQ6[Q6] - valXoffsetSQ6[SQ6]
     */
    rfe_temperature_t denominatorSQ6 = ( valAlpha >> RFE_WH_TSENSE_CONVERSION_BITS_Q11_TO_Q6 ) + xOutSQ6 - valXoffset;

    // Division by zero check
    if ( denominatorSQ6 == RFE_HW_TSENSE_ZERO )
    {
        RFE_ERROR_SET( rfe_error_tSenseDivisionByZero_e );
    }
    else
    {
        /* Numerator of main equation as result of fixed point operations using
         numeratorQ17[Q17] = numeratorQ17[Q6] + valAlphaQ11[Q11]
         */
        uint32_t numerator = ( ( ( uint32_t ) valA ) * ( ( uint32_t ) valAlpha ) ) >> RFE_HW_TSENSE_CONVERSION_BITS_Q12_TO_Q6;
        /* Result of trimmed temperature as result of fixed point
         operations using  tTrimSQ6[SQ6] = (numeratorSQ12[Q12] / denominatorSQ6[SQ6])[SQ6] + valBSQ6[Q6] = [SQ6] + [Q6]
         */
        temperature = ( int16_t ) ( ( numerator / denominatorSQ6 ) ) + valB;
    }
}
#endif
return temperature;

RFE_ERROR_GUARD
{
    rfeHwSpi_register32_t regThresholds = 0x00000000ul;

    if ( ( ( lowerTempThreshold >= RFE_HW_TSENSE_MINIMUM_SUPPORTED_TEMPERATURE_Q6 ) && ( lowerTempThreshold <= RFE_HW_TSENSE_MAXIMUM_SUPPORTED_TEMPERATURE_Q6 ) ) &&
         ( ( higherTempTrehshold >= RFE_HW_TSENSE_MINIMUM_SUPPORTED_TEMPERATURE_Q6 ) && ( higherTempTrehshold <= RFE_HW_TSENSE_MAXIMUM_SUPPORTED_TEMPERATURE_Q6 ) ) )
    {
        // Lower threshold to LSB
        regThresholds = rfeHwSpi_util_modifyShifted( regThresholds,
                                                     RFE_HW_TSENSE_TDC_THR0_THR_LOW_MSK,
                                                     ( rfeHwSpi_register32_t ) lowerTempThreshold,
                                                     RFE_HW_TSENSE_TDC_THR0_THR_LOW_SHF );
        // Value containing both temp thresholds as MSB + LSB
        regThresholds = rfeHwSpi_util_modifyShifted( regThresholds,
                                                     RFE_HW_TSENSE_TDC_THR0_THR_HIGH_MSK,
                                                     ( rfeHwSpi_register32_t ) higherTempTrehshold,
                                                     RFE_HW_TSENSE_TDC_THR0_THR_HIGH_SHF );
        // Write temperature thresholds
        rfeHwSpi_write( rfeHwTsense_indexMapperToSPIModule( tSenseIndex, RFE_ERROR_FUNCTION_ARGUMENT ),
                        RFE_HW_TSENSE_TDC_THR0_REG,
                        regThresholds,
                        RFE_ERROR_FUNCTION_ARGUMENT );

    }
    else
    {
        RFE_ERROR_SET( rfe_error_tSenseInvalidOverUndeThresholds_e );
    }
}

RFE_ERROR_GUARD
{
    if ( ( warningTempThreshold >= RFE_HW_TSENSE_MINIMUM_SUPPORTED_TEMPERATURE_Q6 ) && ( warningTempThreshold <= RFE_HW_TSENSE_MAXIMUM_SUPPORTED_TEMPERATURE_Q6 ) )
    {

        rfeHwSpi_modify( rfeHwTsense_indexMapperToSPIModule( tSenseIndex,
                                                             RFE_ERROR_FUNCTION_ARGUMENT ),
                         RFE_HW_TSENSE_TDC_THR1_REG,
                         RFE_HW_TSENSE_TDC_THR1_THR_WARN_MSK,
                         ( ( rfeHwSpi_register32_t ) warningTempThreshold << RFE_HW_TSENSE_TDC_THR1_THR_WARN_SHF ),
                         RFE_ERROR_FUNCTION_ARGUMENT );
    }
    else
    {
        RFE_ERROR_SET( rfe_error_tSenseInvalidWarningThreshold_e );
    }
}

RFE_ERROR_GUARD
{
    if ( ( hystThreshold >= RFE_HW_TSENSE_MINIMUM_SUPPORTED_TEMPERATURE_Q6 ) && ( hystThreshold <= RFE_HW_TSENSE_MAXIMUM_SUPPORTED_TEMPERATURE_Q6 ) )
    {

        rfeHwSpi_modify( rfeHwTsense_indexMapperToSPIModule( tSenseIndex,
                                                             RFE_ERROR_FUNCTION_ARGUMENT ),
                         RFE_HW_TSENSE_TDC_THR1_REG,
                         RFE_HW_TSENSE_TDC_THR1_THR_HYS_MSK,
                         ( ( rfeHwSpi_register32_t ) hystThreshold << RFE_HW_TSENSE_TDC_THR1_THR_HYS_SHF ),
                         RFE_ERROR_FUNCTION_ARGUMENT );

    }
    else
    {
        RFE_ERROR_SET( rfe_error_tSenseInvalidHysteresisThreshold_e );
    }
}

rfeHwSpi_module_t tempSpiModule = ( rfeHwSpi_module_t ) 0xfful;

RFE_ERROR_GUARD
{
    switch ( tSenseSelect )
    {
        case RFE_TEMP_SELECT_RX:
            tempSpiModule = RFE_HW_SPI_TEMP_1_MODULE;
            break;

        case RFE_TEMP_SELECT_TX12:
            tempSpiModule = RFE_HW_SPI_TEMP_2_MODULE;
            break;

        case RFE_TEMP_SELECT_TX34:
            tempSpiModule = RFE_HW_SPI_TEMP_3_MODULE;
            break;

        case RFE_TEMP_SELECT_XO:
            tempSpiModule = RFE_HW_SPI_TEMP_4_MODULE;
            break;

        case RFE_TEMP_SELECT_ALL:
            tempSpiModule = RFE_HW_SPI_TEMP_MC_MODULE;
            break;

        default:
            RFE_ERROR_SET( rfe_error_parameterOutOfRange_e );
            break;
    }
}

return tempSpiModule;

rfeHwSpi_module_t tempSpiModule = ( rfeHwSpi_module_t ) 0xfful;

RFE_ERROR_GUARD
{
    switch ( tSenseIndex )
    {
        case rfe_temperatureSensorIndex_rx_e:
            tempSpiModule = RFE_HW_SPI_TEMP_1_MODULE;
            break;

        case rfe_temperatureSensorIndex_tx12_e:
            tempSpiModule = RFE_HW_SPI_TEMP_2_MODULE;
            break;

        case rfe_temperatureSensorIndex_tx34_e:
            tempSpiModule = RFE_HW_SPI_TEMP_3_MODULE;
            break;

        case rfe_temperatureSensorIndex_xo_e:
            tempSpiModule = RFE_HW_SPI_TEMP_4_MODULE;
            break;

        default:
            RFE_ERROR_SET( rfe_error_parameterOutOfRange_e );
            break;
    }
}

return tempSpiModule;

rfeHwTsense_fixedPointQ15_t rawReadADC = 0u;

RFE_ERROR_GUARD
{
    if ( rfeHwTsense_getConversionCompleted( tSenseIndex,
                                             rfeHwTsense_temperatureFormat_ADC_value,
                                             RFE_ERROR_FUNCTION_ARGUMENT ) )
    {
        rfeHwSpi_register32_t regValue = rfeHwSpi_read( rfeHwTsense_indexMapperToSPIModule( tSenseIndex, RFE_ERROR_FUNCTION_ARGUMENT ),
                                                        RFE_HW_TSENSE_TDC_OUT1_REG,
                                                        RFE_ERROR_FUNCTION_ARGUMENT );

        rawReadADC = rfeHwTsense_unpackBitsViaMask( regValue,
                                                    RFE_HW_TSENSE_TDC_OUT1_ADCOUT_MSK,
                                                    RFE_HW_TSENSE_TDC_OUT1_ADCOUT_SHF );
    }
    else
    {
        RFE_ERROR_SET( rfe_error_tSenseConversionInProgress_e );
    }
}

return rawReadADC;

rfeHwSpi_register32_t paramAandB = 0x00000000ul;

RFE_ERROR_GUARD
{
    // value A to LSB
    paramAandB = rfeHwSpi_util_modifyShifted( paramAandB,
                                            RFE_HW_TSENSE_TDC_CAL0_VAL_A_MSK,
                                            ( rfeHwSpi_register32_t ) valueA,
                                            RFE_HW_TSENSE_TDC_CAL0_VAL_A_SHF );
    // Value containing both fitting values as LSB + MSB
    paramAandB = rfeHwSpi_util_modifyShifted( paramAandB,
                                            RFE_HW_TSENSE_TDC_CAL0_VAL_B_MSK,
                                            ( rfeHwSpi_register32_t ) valueB,
                                            RFE_HW_TSENSE_TDC_CAL0_VAL_B_SHF );
    // Write fitting params
    rfeHwSpi_write( rfeHwTsense_indexMapperToSPIModule( tSenseIndex, RFE_ERROR_FUNCTION_ARGUMENT ),
                    RFE_HW_TSENSE_TDC_CAL0_REG,
                    paramAandB,
                    RFE_ERROR_FUNCTION_ARGUMENT );

    // Alpha values goes into a different register so we need another SPI transaction
    rfeHwSpi_modify( rfeHwTsense_indexMapperToSPIModule( tSenseIndex, RFE_ERROR_FUNCTION_ARGUMENT ),
                     RFE_HW_TSENSE_TDC_CAL1_REG,
                     RFE_HW_TSENSE_TDC_CAL1_VAL_ALPHA_MSK,
                     ( ( rfeHwSpi_register32_t ) valueAlpha << RFE_HW_TSENSE_TDC_CAL1_VAL_ALPHA_SHF ),
                     RFE_ERROR_FUNCTION_ARGUMENT );

}

// Write X offset
rfeHwSpi_modify( rfeHwTsense_indexMapperToSPIModule( tSenseIndex, RFE_ERROR_FUNCTION_ARGUMENT ),
                 RFE_HW_TSENSE_TDC_CAL1_REG,
                 RFE_HW_TSENSE_TDC_CAL1_VAL_XOFFSET_MSK,
                 ( ( rfeHwSpi_register32_t ) valueXOffset << RFE_HW_TSENSE_TDC_CAL1_VAL_XOFFSET_SHF ),
                 RFE_ERROR_FUNCTION_ARGUMENT );

rfeHwSpi_register32_t regValue = reg;

    regValue &= mask ;
    regValue >>= sfhit ;

    return ( (rfe_temperature_t) regValue );
